  part Risk
  part FailureScenario
  part FailureConsequence
  part SeverityLevel
}

class Battery {
  attribute batteryLevel : Float
  attribute minThreshold : Float
  attribute agingFactor : Float
}

class Risk {
  attribute riskProbability : Float
  attribute riskDescription : String
}

class FailureScenario {
  attribute scenarioDescription : String
  attribute failureConsequence : FailureConsequence
}

class FailureConsequence {
  attribute consequenceDescription : String
  attribute severityLevel : SeverityLevel
}

class SeverityLevel {
  attribute severityValue : Float
  attribute severityDescription : String
}

class System {
  part Equipment
  part Risk
  1..* FailureScenario
  1..* FailureConsequence
  1..* SeverityLevel
}

class BatteryAgingRisk {
  part Battery
  part Risk
}

class LowBatteryLevel {
  part Battery
  part FailureScenario
}

